import httpclient from '@/utils/httpclient';
import searchMap from '@components/searchMap';
export default {
  name: "allShop",
  components: {
    searchMap: searchMap
  },
  data: function data() {
    return {
      card: {
        "inventory": {
          name: "m.index.inventory",
          img: require('@assets/pages-img/inven-icon.svg'),
          type: "inventory",
          class: "bg-primary",
          style: "blue",
          num: "",
          filters: null,
          key: '',
          value: '',
          link: "/vehicle"
        },
        "offLots": {
          name: "m.index.offlot",
          img: require('@assets/pages-img/off-lot.svg'),
          type: "offLots",
          class: "bg-info",
          style: "pure-blue",
          num: "",
          filters: null,
          key: '',
          value: '',
          link: ""
        },
        "extremelyLowPower": {
          name: "m.index.low",
          img: require('@assets/pages-img/low-bat.svg'),
          type: "extremelyLowPower",
          class: "bg-warning",
          style: "yellow",
          num: "",
          filters: null,
          key: '',
          value: '',
          link: ""
        },
        "saleVehicleCount": {
          name: "m.sold_vehicle.vehicle_sold",
          img: "https://pic.zus.ai/saas/sold.svg",
          type: "saleVehicle",
          class: "bg-danger",
          style: "red",
          num: "",
          filters: null,
          key: '',
          value: '',
          link: "/sold-manager/list"
        }
      },
      data: null,
      map: null
    };
  },
  mounted: function mounted() {
    this.initData();
  },
  methods: {
    initData: function initData() {
      var _this = this;

      httpclient.get("/api/v1/index", {}).then(function (response) {
        _this.filterData(response.data.data);
      }).catch(function (err) {
        console.log(err);
      });
    },
    linkTo: function linkTo(type) {
      if (type == "inventory") {
        this.$router.push({
          name: 'vehicle',
          query: {
            filters: "[{\"key\": \"inventory\", \"value\": [1]}]"
          }
        });
      } else if (type == "offLots") {
        this.$router.push({
          name: 'vehicle',
          query: {
            filters: "[{\"key\":\"parking\",\"value\":[2]}]"
          }
        });
      } else if (type == "extremelyLowPower") {
        this.$router.push({
          name: 'vehicle',
          query: {
            filters: "[{\"key\":\"battery\",\"value\":[1]}]"
          }
        });
      } else {
        this.$router.push('/sold-manager/list');
      }
    },
    filterData: function filterData(data) {
      this.data = data;
      this.map = data.searchMapDTO;

      for (var item in this.card) {
        this.card[item]["num"] = data[item] ? data[item]["num"] : "";
        this.card[item]["filters"] = data[item] ? data[item]["filters"] : "";
        this.card[item]["key"] = data[item] ? data[item]["filters"][0].key : "";
        this.card[item]["value"] = data[item] ? data[item]["filters"][0].value[0] : "";
      }
    }
  }
};
